import React from "react";
import "../../styles/team.css";

const Team = () => {
  return (
    <section>
      <div className="container">
        <div className="team__content">
          <h6 className="subtitle">Our Team</h6>
          <h2>
            Meet with <span className="highlight">our team</span>
          </h2>
        </div>
      </div>
    </section>
  );
};

export default Team;
